import Vue from 'vue'

import ThemeLayout from '@themeLayout'
import ThemeNotFound from '@themeNotFound'
import { injectMixins } from '@app/util'
import rootMixins from '@app/root-mixins'

injectMixins(ThemeLayout, rootMixins)
injectMixins(ThemeNotFound, rootMixins)

export const routes = [
  {
    name: "v-cc01ab01b2a86",
    path: "/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("E:\\Work\\Code\\myBlog\\docs\\README.md").then(comp => {
        Vue.component("v-cc01ab01b2a86", comp.default)
        next()
      })
    }
  },
  {
    path: "/index.html",
    redirect: "/"
  },
  {
    name: "v-1ed2f81687099",
    path: "/accumulate/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("E:\\Work\\Code\\myBlog\\docs\\accumulate\\README.md").then(comp => {
        Vue.component("v-1ed2f81687099", comp.default)
        next()
      })
    }
  },
  {
    path: "/accumulate/index.html",
    redirect: "/accumulate/"
  },
  {
    name: "v-325fabc119237",
    path: "/algorithm/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("E:\\Work\\Code\\myBlog\\docs\\algorithm\\README.md").then(comp => {
        Vue.component("v-325fabc119237", comp.default)
        next()
      })
    }
  },
  {
    path: "/algorithm/index.html",
    redirect: "/algorithm/"
  },
  {
    name: "v-510102fb188ec",
    path: "/guide.html",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("E:\\Work\\Code\\myBlog\\docs\\guide.md").then(comp => {
        Vue.component("v-510102fb188ec", comp.default)
        next()
      })
    }
  },
  {
    name: "v-42870e43b32d8",
    path: "/others/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("E:\\Work\\Code\\myBlog\\docs\\others\\README.md").then(comp => {
        Vue.component("v-42870e43b32d8", comp.default)
        next()
      })
    }
  },
  {
    path: "/others/index.html",
    redirect: "/others/"
  },
  {
    path: '*',
    component: ThemeNotFound
  }
]
